import React from 'react';
import './App.css';
import Nav from './Nav';
import Portfolio from './Portfolio';
import About from './About';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Nav />
      <Portfolio />
      <About />
    </div>
  );
}

export default App;
